import{_ as t,c as e,o as n,a4 as o}from"./chunks/framework.uQk9_EO2.js";const r="/docs/cocos/assets/menu.j8-bckQZ.png",s="/docs/cocos/assets/file.DQLekiMg.png",a="/docs/cocos/assets/edit.a6YLRgPM.png",l="/docs/cocos/assets/node.4KL1qW1A.png",d="/docs/cocos/assets/project.BV9PRzOG.png",i="/docs/cocos/assets/panel.AVQ04oZs.png",c="/docs/cocos/assets/extension.Zku7FnbU.png",g="/docs/cocos/assets/developer.B9-MKc5w.png",h="/docs/cocos/assets/help.Dgi1rWMy.png",S=JSON.parse('{"title":"Main Menu","description":"","frontmatter":{},"headers":[],"relativePath":"en/editor/mainMenu/index.md","filePath":"en/editor/mainMenu/index.md","lastUpdated":1712305443000}'),f={name:"en/editor/mainMenu/index.md"},p=o('<h1 id="main-menu" tabindex="-1">Main Menu <a class="header-anchor" href="#main-menu" aria-label="Permalink to &quot;Main Menu&quot;">​</a></h1><p>The main menu bar at the top of Cocos Creator contains 9 menu options, <strong>Cocos Creator</strong>, <strong>File</strong>, <strong>Edit</strong>, <strong>Node</strong>, <strong>Project</strong>, <strong>Panel</strong>, <strong>Extension</strong>, <strong>Developer</strong> and <strong>Help</strong>, which integrate most of Cocos Creator&#39;s functionalities.</p><p><img src="'+r+'" alt="menu"></p><h2 id="file" tabindex="-1">File <a class="header-anchor" href="#file" aria-label="Permalink to &quot;File&quot;">​</a></h2><p>This option is mainly used to create, open, and save a project or scene, as well as import Cocos Creator 2.x projects.</p><p><img src="'+s+'" alt="file"></p><table><thead><tr><th style="text-align:left;">Option</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;">New Project</td><td style="text-align:left;">Opens Dashboard&#39;s <a href="./../../getting-started/dashboard/#project">Project</a> tab of Dashboard to create a new project. If you are using Dashboard v1.0.19, you will open Dashboard&#39;s <a href="./../../getting-started/dashboard/#new-project">New Project</a> tab.</td></tr><tr><td style="text-align:left;">Open Project</td><td style="text-align:left;">Open Dashboard&#39;s <a href="./../../getting-started/dashboard/#project">Project</a> tab.</td></tr><tr><td style="text-align:left;">New Scene (<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>N</kbd>)</td><td style="text-align:left;">Closes the current scene and create a new scene, the newly created scene needs to be saved manually before it will be added to the project directory.</td></tr><tr><td style="text-align:left;">Save Scene (<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>S</kbd>)</td><td style="text-align:left;">Save the scene you are currently editing. If the scene is created using <strong>File -&gt; New Scene</strong>, a dialog box will pop up when you save it for the first time, you need to choose the location to save the scene file and fill in the file name, then click <strong>Save</strong> to save it. Scene files have <code>.scene</code> as extension.</td></tr><tr><td style="text-align:left;">Save As (<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> +<kbd>Shift</kbd>+ <kbd>S</kbd>)</td><td style="text-align:left;">Generates a copy of the current scene file and save it in the project.</td></tr><tr><td style="text-align:left;">Layout</td><td style="text-align:left;">Sets the editor interface layout. Custom layout can be saved and re-uesed</td></tr><tr><td style="text-align:left;">Preferences</td><td style="text-align:left;">Opens <a href="./../preferences/">Preferences</a> panel to customize the editor.</td></tr><tr><td style="text-align:left;">Shortcuts</td><td style="text-align:left;">Opens the Shortcuts panel to view the default shortcuts used by each panel or function module of the editor, support customization.</td></tr><tr><td style="text-align:left;">Import Cocos Creator 2.x Project</td><td style="text-align:left;">V2.x asset import tool, supporting the perfect import of old project assets, as well as the assisted migration of code. Please refer to <a href="./../../release-notes/upgrade-guide-v3.0">v3.0 Upgrade Guide</a> for details.</td></tr><tr><td style="text-align:left;">Close Window (<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>W</kbd>)</td><td style="text-align:left;">Closes current window.</td></tr><tr><td style="text-align:left;">Exit</td><td style="text-align:left;">Closes the current editor and automatically opens Dashboard.</td></tr></tbody></table><h2 id="edit" tabindex="-1">Edit <a class="header-anchor" href="#edit" aria-label="Permalink to &quot;Edit&quot;">​</a></h2><p>This option mainly includes common editing functions such as undo, redo, copy and paste.</p><p><img src="'+a+'" alt="edit"></p><table><thead><tr><th style="text-align:left;">Option</th><th style="text-align:left;">Description</th><th style="text-align:left;">Default Shortcut</th></tr></thead><tbody><tr><td style="text-align:left;">Undo</td><td style="text-align:left;">Undoes the last change to the scene.</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Z</kbd></td></tr><tr><td style="text-align:left;">Redo</td><td style="text-align:left;">Redoes the undo action from the previous step.</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Shift</kbd> + <kbd>Z</kbd></td></tr><tr><td style="text-align:left;">Cut</td><td style="text-align:left;">Cuts the currently selected node or character to the clipboard.</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>X</kbd></td></tr><tr><td style="text-align:left;">Copy</td><td style="text-align:left;">Copies the currently selected node or character to the clipboard.</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>C</kbd></td></tr><tr><td style="text-align:left;">Paste</td><td style="text-align:left;">Paste the contents of the clipboard into the appropriate location.</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>V</kbd></td></tr><tr><td style="text-align:left;">Select All</td><td style="text-align:left;">Selects all nodes in the same hierarchy if the focus is within the <strong>Hierarchy</strong> panel, or all assets in the same hierarchy if the focus is in the <strong>Assets</strong> panel.</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>A</kbd></td></tr></tbody></table><blockquote><p><strong>Note</strong>: <strong>Copy</strong>, <strong>Cut</strong> and <strong>Paste</strong> of nodes should be done using shortcut keys.</p></blockquote><h2 id="nodes" tabindex="-1">Nodes <a class="header-anchor" href="#nodes" aria-label="Permalink to &quot;Nodes&quot;">​</a></h2><p>This option contains functions to adjust the view, disconnect prefabricated nodes and create nodes.</p><p><img src="'+l+'" alt="node"></p><table><thead><tr><th style="text-align:left;">Option</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;">Align With View (<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Shift</kbd> + <kbd>F</kbd>)</td><td style="text-align:left;">Moves the currently selected node to the center of the view of the <strong>Scene</strong> panel.</td></tr><tr><td style="text-align:left;">Align View With Node</td><td style="text-align:left;">Sets the view in the <strong>Scene</strong> panel to be centered on the currently selected node.</td></tr><tr><td style="text-align:left;">Disconnect Node With Prefab Asset</td><td style="text-align:left;">For converting the selected prefab node to a normal node, please refer to <a href="./../../asset/prefab">Prefab</a> for details.</td></tr><tr><td style="text-align:left;">Disconnect Node With Prefab Asset Recursively</td><td style="text-align:left;">Recursively convert prefab nodes containing nested nodes in the scene to normal nodes, see <a href="./../../asset/prefab">Prefab</a> for details.</td></tr><tr><td style="text-align:left;">Empty Node</td><td style="text-align:left;">Creates an empty node in the scene. If the node is already selected in the scene before the command is executed, the newly created node will become a child of the selected node.</td></tr><tr><td style="text-align:left;">3D Objects</td><td style="text-align:left;">Creator provides some relatively basic static model controls for use, currently including <strong>Cube</strong>, <strong>Cylinder</strong>, <strong>Sphere</strong>, <strong>Capsule</strong>, <strong>Cone</strong>, <strong>Torus</strong>, <strong>Flat</strong> and <strong>Quad</strong>. To create other types of models, refer to the <a href="./../../engine/renderable/model-component">MeshRenderer component</a> documentation.</td></tr><tr><td style="text-align:left;">2D Objects</td><td style="text-align:left;">Create Creator&#39;s pre-defined 2D nodes in the scene containing the base renderable components, which currently include <strong>Graphics</strong>, <strong>Label</strong>, <strong>Mask</strong>, <strong>ParticleSystem2D</strong>, <strong>Sprite</strong>, <strong>SpriteSplash</strong> (monochrome) and <strong>TiledMap</strong> (map), for details please refer to the <a href="./../../ui-system/components/editor/render-component">Introduction to 2D Renderable Components</a> documentation.</td></tr><tr><td style="text-align:left;">UI Components</td><td style="text-align:left;">Create Creator&#39;s pre-defined nodes containing basic UI components in the scene, which currently include Common UI controls such as <strong>Button</strong>, <strong>Widget</strong>, <strong>Layout</strong>, <strong>ScrollView</strong>, <strong>EditBox</strong> nodes, etc. For more UI components, please refer to the <a href="./../../ui-system/components/editor/base-component">UI Basic Components</a> documentation.</td></tr><tr><td style="text-align:left;">Lighting</td><td style="text-align:left;">Create Creator preset nodes in the scene containing base light components, currently including <strong>Parallel Light</strong>, <strong>Spherical Light</strong> and <strong>Spot Light</strong>, please refer to the <a href="./../../concepts/scene/light">Lighting</a> documentation.</td></tr><tr><td style="text-align:left;">Effects</td><td style="text-align:left;">Create a Creator preset in the scene containing <a href="./../../particle-system/overview">Particle System</a> component in the scene. More effects components can be added in the <strong>Property Inspector</strong> panel by clicking <strong>Add Component -&gt; Special Effects</strong>.</td></tr><tr><td style="text-align:left;">Camera</td><td style="text-align:left;">Creates a node in the scene with the Camera component pre-defined by Creator. For details on how to use it, please refer to the <a href="./../components/camera-component">Camera component</a> documentation.</td></tr><tr><td style="text-align:left;">Terrain</td><td style="text-align:left;">Creates a node containing the terrain component pre-defined by Creator in the scene. Please refer to the <a href="./../terrain/">Terrain System</a> documentation for more details on how to use it.</td></tr></tbody></table><h2 id="project" tabindex="-1">Project <a class="header-anchor" href="#project" aria-label="Permalink to &quot;Project&quot;">​</a></h2><p>This option is mainly used to perform preview run build projects, project configuration and custom builds, etc.</p><p><img src="'+d+'" alt="project"></p><table><thead><tr><th style="text-align:left;">Option</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;">Project Settings</td><td style="text-align:left;">Opens <a href="./../project/">Project Settings</a> panel to set the relevant configuration options for a specific project.</td></tr><tr><td style="text-align:left;">Play on Device (<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>P</kbd>)</td><td style="text-align:left;">Click on this option to preview the project in the selected browser/simulator window, for details please refer to the <a href="./../preview/">Project Preview &amp; Debugging</a> documentation.</td></tr><tr><td style="text-align:left;">Refresh Device (<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Shift</kbd> + <kbd>P</kbd>)</td><td style="text-align:left;">Refreshes the opened browser preview window.</td></tr><tr><td style="text-align:left;">Create Preview Template</td><td style="text-align:left;">This option is used to customize the desired preview effect, please refer to the <a href="./../preview/browser">Web Preview Customization Workflow</a> documentation for details.</td></tr><tr><td style="text-align:left;">Build (<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Shift</kbd> + <kbd>B</kbd>)</td><td style="text-align:left;">Opens the <a href="./../publish/">Build</a> panel to package the game to the target platform.</td></tr><tr><td style="text-align:left;">Create Build Template</td><td style="text-align:left;">This option is used to customize the Build panel of the project, please refer to the <a href="./../publish/custom-project-build-template">Custom Project Build Process</a> documentation for details.</td></tr><tr><td style="text-align:left;">Generate Build Extension</td><td style="text-align:left;">This option is used to extend the build process, please refer to the <a href="./../publish/custom-build-plugin">Extending Build Process</a> documentation for details.</td></tr></tbody></table><h2 id="panel" tabindex="-1">Panel <a class="header-anchor" href="#panel" aria-label="Permalink to &quot;Panel&quot;">​</a></h2><p>This option is mainly used to open various panels in the editor.</p><p><img src="'+i+'" alt="panel"></p><table><thead><tr><th style="text-align:left;">Option</th><th style="text-align:left;">Description</th><th style="text-align:left;">Default Shortcut</th></tr></thead><tbody><tr><td style="text-align:left;">Console</td><td style="text-align:left;">Opens <a href="./../console/">Console</a>. For viewing the output log messages.</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>0</kbd></td></tr><tr><td style="text-align:left;">Scene</td><td style="text-align:left;">Opens the <a href="./../scene/">Scene</a> panel. For selecting and placing various game elements such as scene images, characters, effects, UI, etc.</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>1</kbd></td></tr><tr><td style="text-align:left;">Assets</td><td style="text-align:left;">Opens <strong>Assets</strong>/<strong>Assets Preview</strong> panel. For accessing/managing/viewing project assets, please refer to the <a href="./../assets/">Assets</a> documentation for details.</td><td style="text-align:left;">The shortcut for the <strong>Assets</strong> panel is <kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>2</kbd></td></tr><tr><td style="text-align:left;">Inspector</td><td style="text-align:left;">Opens the <a href="./../inspector/">Inspector</a> panel. For viewing and editing the working area of the currently selected node, node components and assets.</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>3</kbd></td></tr><tr><td style="text-align:left;">Hierarchy</td><td style="text-align:left;">Opens the <a href="./../hierarchy/">Hierarchy</a> panel, which shows the hierarchical relationship between all nodes in the scene in the form of a tree-like list.</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>4</kbd></td></tr><tr><td style="text-align:left;">Animation</td><td style="text-align:left;">Opens the <a href="./../../animation/">Animation</a> panel or <a href="./../../animation/joint-texture-layout">Joint Texture Layout</a> panel. For editing and viewing frame animation or skeleton animation, etc.</td><td style="text-align:left;">The shortcut for the <strong>Animation</strong> panel is <kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>6</kbd></td></tr><tr><td style="text-align:left;">Animation Graph</td><td style="text-align:left;">Opens the <a href="./../../animation/marionette/">Animation Graph</a> panel. Animated Graphics and Program Animation is a visual animation editing panel.</td><td style="text-align:left;">The shortcut for the <strong>Animation</strong> panel is <kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>5</kbd></td></tr><tr><td style="text-align:left;">Light Baking</td><td style="text-align:left;">Opens the <a href="./../../concepts/scene/light/lightmap">Lightmapping</a> panel to configure the baking properties for generating light maps.</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">Node Library</td><td style="text-align:left;">Open the Node Prefab Library panel. This panel is a very simple and straightforward visual control repository, where developers can drag and drop the controls listed here into the <strong>Scene</strong> or the <strong>Hierarchy</strong> panel to quickly create pre-configured controls.</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>7</kbd></td></tr><tr><td style="text-align:left;">Service</td><td style="text-align:left;">Opens the <a href="https://service.cocos.com/document/en" target="_blank" rel="noreferrer">Service</a> panel, which provides a number of quality official and third-party services that allow developers to access more extensions beyond the engine and make game development easier.</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd </kbd> + <kbd>8</kbd></td></tr><tr><td style="text-align:left;">Reference Image</td><td style="text-align:left;">Opens the <a href="./../../editor/scene/#reference-image">reference image</a> panel when creating UI in the scene</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd </kbd> + <kbd>8</kbd></td></tr><tr><td style="text-align:left;">Service</td><td style="text-align:left;">Opens the <a href="https://service.cocos.com/document/en" target="_blank" rel="noreferrer">Service</a> panel, which provides a number of quality official and third-party services that allow developers to access more extensions beyond the engine and make game development easier.</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd </kbd> + <kbd>9</kbd></td></tr><tr><td style="text-align:left;">Localization Editor</td><td style="text-align:left;">Opens the <a href="./../l10n/overview">L10N</a> panel.</td><td style="text-align:left;"></td></tr></tbody></table><h2 id="extension" tabindex="-1">Extension <a class="header-anchor" href="#extension" aria-label="Permalink to &quot;Extension&quot;">​</a></h2><p>This option mainly includes Extension Manager, Store and Create Extension, please refer to the <a href="./../extension/readme">Extending the Editor</a> chapter.</p><p><img src="'+c+'" alt="extension"></p><table><thead><tr><th style="text-align:left;">Option</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;">Extension Manager</td><td style="text-align:left;">Opens the <strong>Extension Manager</strong> panel, which includes editor built-in extensions, extensions installed in project directory and global directory, please refer to the <a href="./../extension/readme">Extending the Editor</a> chapter for details.</td></tr><tr><td style="text-align:left;">Store</td><td style="text-align:left;">The <a href="https://store.cocos.com/app/" target="_blank" rel="noreferrer">Cocos Store</a> is built into Cocos Creator and allows users to browse, download and automatically install official or third-party extensions and assets. You can also submit your own extensions, art materials, music and sound effects to the extension store for sharing or selling. For more information, please refer to the <a href="./../extension/store/upload-store">Submitting Resources to Store</a> documentation.</td></tr><tr><td style="text-align:left;">Create Extension</td><td style="text-align:left;">This option is used to generate an <a href="./../extension/first">extension package</a> in the project/global directory to extend the editor with features.</td></tr></tbody></table><h2 id="developer" tabindex="-1">Developer <a class="header-anchor" href="#developer" aria-label="Permalink to &quot;Developer&quot;">​</a></h2><p>This option contains mainly development-related menu functions such as scripts, engine and DevTools.</p><p><img src="'+g+'" alt="developer"></p><table><thead><tr><th style="text-align:left;">Option</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;">Compile Engine (<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>F7</kbd>)</td><td style="text-align:left;">Compile custom engine, please refer to the <a href="./../../advanced-topics/engine-customization">Engine Customization Workflow</a> documentation.</td></tr><tr><td style="text-align:left;">Rebuild Native Engine</td><td style="text-align:left;">Compile the custom native engine simulator, please refer to <a href="./../../advanced-topics/engine-customization#modifying-native-engine-simulator">Customizing the Native Engine Simulator</a>.</td></tr><tr><td style="text-align:left;">Message DevTools</td><td style="text-align:left;">Opens the Message DevTool for debugging IPC interactions at runtime inside the editor.</td></tr><tr><td style="text-align:left;">Tester</td><td style="text-align:left;">The editor&#39;s built-in extended testing tool, not yet fully functional</td></tr><tr><td style="text-align:left;">Toggle Graphics Tool</td><td style="text-align:left;">Toggles the Graphics tool panel for debugging scene rendering.</td></tr><tr><td style="text-align:left;">Message Manager</td><td style="text-align:left;">Opens the <a href="./../extension/contributions-messages">Message Manager</a> panel to display public messages and their descriptions for each feature defined by the editor.</td></tr><tr><td style="text-align:left;">Export.d.ts</td><td style="text-align:left;">Exports editor-related APIs.</td></tr><tr><td style="text-align:left;">Reload (<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>R</kbd>)</td><td style="text-align:left;">Reload the editor interface.</td></tr><tr><td style="text-align:left;">UI Components</td><td style="text-align:left;">Opens the UI Components panel, which lists how to use the pre-defined UI components provided within the editor, please refer to <a href="./../extension/ui">UI Components</a>.</td></tr><tr><td style="text-align:left;">Cache</td><td style="text-align:left;">The <strong>clear code cache</strong> in this option is used to clear the cache generated when compiling scripts.</td></tr><tr><td style="text-align:left;">VS Code Workflow</td><td style="text-align:left;">The working environment-related features of the VS Code editor, currently supporting <strong>Add Chrome Debug Setting</strong> and <strong>Add Compile Task</strong>. Please refer to the <a href="./../../scripting/coding-setup">Coding Environment Setup</a> documentation for details.</td></tr><tr><td style="text-align:left;">Toggle DevTools (<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Shift</kbd> + <kbd>I</kbd>)</td><td style="text-align:left;">Opens DevTools window for editor interface extension development. It is also possible to customize the log output to <strong>Console</strong>, please refer to <a href="./../console/#custom-output-messages">Custom output messages</a>.</td></tr><tr><td style="text-align:left;">Open Assets DevTools</td><td style="text-align:left;">Opens the Assets DevTool panel for viewing log messages during modifications to the asset-db process.</td></tr><tr><td style="text-align:left;">Open Scene DevTools</td><td style="text-align:left;">Opens the Scene DevTool panel to view log messages during modifications to the scene.</td></tr><tr><td style="text-align:left;">Open Build DevTools</td><td style="text-align:left;">Opens the Build DevTool to view all log messages generated during the build process including the call stack.</td></tr></tbody></table><h2 id="help" tabindex="-1">Help <a class="header-anchor" href="#help" aria-label="Permalink to &quot;Help&quot;">​</a></h2><p><img src="'+h+'" alt="help"></p><table><thead><tr><th style="text-align:left;">Option</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;">User Manual</td><td style="text-align:left;">Open <a href="./../../">User Manual</a> in default browser.</td></tr><tr><td style="text-align:left;">API Reference</td><td style="text-align:left;">Open <a href="./__APIDOC__/en/">API Reference Documentation</a> in default browser.</td></tr><tr><td style="text-align:left;">Forum</td><td style="text-align:left;">Open <a href="https://discuss.cocos2d-x.org/c/33" target="_blank" rel="noreferrer">Cocos Creator Forum</a> in default browser.</td></tr><tr><td style="text-align:left;">Release Notes</td><td style="text-align:left;">Open the <a href="https://www.cocos.com/creator-download" target="_blank" rel="noreferrer">release notes</a> for each version of Cocos Creator in default browser.</td></tr><tr><td style="text-align:left;">Engine Repository</td><td style="text-align:left;">Open <a href="https://github.com/cocos/cocos-engine" target="_blank" rel="noreferrer">TypeScript Engine Repository</a> in default browser.</td></tr><tr><td style="text-align:left;">About Cocos Creator</td><td style="text-align:left;">Shows Cocos Creator-related version number and copyright information.</td></tr></tbody></table>',35),b=[p];function y(m,u,x,k,C,v){return n(),e("div",null,b)}const P=t(f,[["render",y]]);export{S as __pageData,P as default};
